import React from 'react'
import namedb from './names'

const showListofNames = (props) => {
    return(
        <ul>
            {namedb.names.map(n => (
                <li key={n.name}>
                    {n.name} {n.amount}
                </li>
            ))}
        </ul>
    )
}


const App = () => {
  return (
    <div>
        {showListofNames()}
    </div>
  )

}

export default App
